        emit log("B.func1", 31);
    }

    function fun2() public virtual override{
        emit log("B.func2", 31);
    }

}

contract C is A{

    function fun1() public virtual override {
        emit log("C.func1", 44);
    }

    function fun2() public virtual override{
        emit log("C.func2", 44);
    }

}

contract  D is B,C{

    function fun1() public virtual override(B,C) {
        emit log("D.func1", 85);
    }

    function fun2() public virtual override(B,C){
        emit log("D.func2", 85);
    }
}

